eval("\n\nObject.defineProperty(exports, \"__esModule\", {\n  value: true\n});\nexports.default = {\n  jobs: {\n    tybee: {\n      // -----------JOB-tybee-----------\n      href: \"https://visittybee.com\",\n      img: \"tybee.png\",\n      // logo: \"tybee-logo.png\",\n      title: \"Visit Tybee Island\",\n      skills: [\"Drupal 7\", \"CMS Structuring\", \"Custom PHP\", \"Custom Drupal Modules\", \"Google DFP Ads\"],\n      desc: \"This was one of my first builds at Miles Partnership. It's a really clean, interactive, Destination Marketing site built in Drupal 7. We used a lot of custom modules and features and relied heavily on component based CMS building. This project was a ton of fun to help familiarize myself with destination style marketing!\"\n    },\n    otis: {\n      // -----------JOB-otis-----------\n      href: \"https://www.otisspunkmeyer.com\",\n      img: \"otis.jpg\",\n      logo: \"otis-logo.png\",\n      title: \"Otis Spunkmeyer\",\n      skills: [\"Drupal 8\", \"CMS Structuring\", \"Custom PHP\", \"TWIG Templating\", \"CSS Positioning\", \"Flex Layout\"],\n      //additional_imgs: [],\n      desc: \"While working at Hark, I replatformed the entire site from their old custom CMS into Drupal 8 in May 2017. They needed an easier way to manage their SEO and content and Drupal fit the bill. In November of 2017, I built off the same backend but rethemed the site. This was a massive undertaking. The PSD mockup was 37 pages for mobile/desktop.\"\n    },\n    labrea: {\n      // -----------JOB-labrea-----------\n      href: \"https://www.labreabakery.com/kroger\",\n      img: \"labrea.jpg\",\n      logo: \"labrea-logo.png\",\n      title: \"La Brea Bakery\",\n      skills: [\"Drupal 8\", \"CMS Structuring\", \"Custom PHP\", \"TWIG Templating\", \"CSS Positioning\", \"Flex Layout\"],\n      desc: \"I coded image galleries to the Bread sections. Re-Templated the Recipes pages. I also developed 5 different landing pages for various product promotions.\"\n    },\n    zevia: {\n      // -----------JOB-zevia-----------\n      href: \"https://www.zevia.com/sugar-reduction\",\n      img: \"zevia.jpg\",\n      logo: \"zevia-logo.png\",\n      title: \"Zevia\",\n      skills: [\"Drupal 8\", \"Youtube API\", \"Mobile Video\", \"Flex Layout\", \"PSD > E-Mail Templating\"],\n      desc: \"I developed multiple landing pages to promote things like Ferdinand the movie, Health, etc. The Sugar Reduction landing page featured the youtube API and needed to maintain a borderless aspect ratio, as well as working across all mobile and desktop devices. I redid their current blog pages (teaser & full template). I also created bi-monthly Mailchimp templates for them in HTML from their PSDs.\"\n    },\n    hark: {\n      // -----------JOB-hark-----------\n      href: \"https://www.hark.bz\",\n      img: \"hark.png\",\n      logo: \"hark-logo.png\",\n      title: \"Hark Digital\",\n      skills: [\"Wordpress\", \"CSS Animations\", \"Flex Layout\", \"CMS Structuring\", \"Custom PHP\"],\n      desc: \"I helped replatform the current version of their site on Wordpress using wordpressify a node compiler for WP. I leveraged Masonry/Infinite scroll together to manage larger lists of content. I coded this site with limited modules and lots of custom queries/templating. The contact page has a nice label slide up effect when entering input.\"\n    },\n    nsb: {\n      // -----------JOB-nsb-----------\n      href: \"https://www.nsbvt.com/mortgages/first-time-homebuying\",\n      img: \"nsb.jpg\",\n      logo: \"nsb-logo.png\",\n      title: \"Northfield Savings Bank\",\n      desc: \"I coded the Pathway Mortgage landing page. A fully responsive page to create a call to action for first time home buyers. Features a nicely styled jquery accordion list.\"\n    },\n    cbv: {\n      // -----------JOB-cbv-----------\n      href: \"https://www.communitybarnventures.com/client-spotlight\",\n      img: \"cbv.png\",\n      logo: \"cbv-logo.png\",\n      title: \"Community Barn Ventures\",\n      skills: [\"Drupal 8\", \"CSS Grid\", \"CMS Structuring\", \"Slick Slider\", \"CSS Positioning\", \"Flex Layout\"],\n      desc: \"I coded the Client Landing Page, Individual Pages, sliders, client blocks, and Testimonials. The LP has a client grid that leverages CSS Grid and jQuery. I wrote some JS to arrange the bigger clients into predefined spaces then fills the smaller clients in around them, without any unwanted spaces. Its also completely responsive and will rearrange the grid based on screen size.<br><br><a target='_blank' href='https://codepen.io/erawk26/pen/LQoXEw'>CodePen Example</a>\"\n    },\n    mbf: {\n      // -----------JOB-mbf-----------\n      href: \"https://www.mbfbioscience.com\",\n      img: \"mbf.jpg\",\n      logo: \"mbf-logo.png\",\n      title: \"MBF Bioscience\",\n      skills: [\"Drupal 7\", \"Responsive Styling\", \"CMS Structuring\", \"Drupal Paragraphs\", \"Custom PHP\", \"CSS Positioning\", \"Flex Layout\"],\n      desc: \"We Added a mobile menu to their site. This proved to be quite intensive due to the way their current menu plugin was working. We also reconfigured their content templates to give the author custom control of each sections background color, borders, etc.\"\n    },\n    foursight: {\n      // -----------JOB-4sight-----------\n      href: \"https://www.go4sight.com/blog\",\n      img: \"4sight.jpg\",\n      logo: \"4sight-logo.png\",\n      title: \"4 Sight\",\n      desc: \"They had a Drupal 7 site with a lot of resources (articles, blog posts, case studies, etc) that needed to be filtered better. We added and improved upon their existing filters as well as reformatting their blog templates.\"\n    },\n    // \"baristas\":{\n    //   // -----------JOB-baristas-----------\n    //   //   href: \"https://baristasbeans.com\",\n    //   img: \"port1.jpg\",\n    //   logo: \"baristas-logo.png\",\n    //   title: \"Barista's Beans\",\n    //   desc:\n    //     \"My eCommerce mobile-first site built off of Drupal 7. It featured recurring coffee subscriptions. It was very secure and easy to maintain. Everything got backed up and updated through SSH/Drush.\"\n    // },\n    portfolio: {\n      // -----------JOB-portfolio-----------\n      href: \"https://github.com/erawk26/portfolio\",\n      img: \"portfolio.png\",\n      logo: \"\",\n      title: \"This Portfolio\",\n      skills: [\"ES6+ VanillaJS\", \"VueJS\", \"Serverless Lambda Form\", \"Greensock Animations\", \"PUG Templating\", \"Webpack Bundler\", \"CSS Grid\", \"Flex Layout\", \"no jQuery\"],\n      desc: \"I built my portfolio with ES6 VanillaJS and Vue. It leverages Webpack to compile all my code, images, and single file components into a nice optimized bundle that is cross browser compatible and easy to deploy. I really enjoy working in Vue and I think single file components could be the future of web development.<br><br><a target='_blank' href='https://github.com/erawk26/portfolio' title='Browse this GitHub repo'>GitHub Repo</a>\"\n    }\n  }\n};//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./src/js/projects.js\n");

